				<h1 class="shead-style text-center" style="font-size: 4em;">ANDHRA PRADESH</h1>
				<p>Having one of the oldest traditions of India this historically rich and colourful land has been part of the subcontinent for thousands of years. A land of progressive union and diverse landscape is best way it can represent itself. Previously as the whole of Telugu speaking region now it stands separate from its neighbor telugu speaking state telengana. Because of the succession the region is smaller but still incredibly beautiful and as before carries the name Andhra Pradesh.</p><p>
				A region comprising of mountains, rivers, forest lands its beauty is redefined by the long coastal line it has. A very diverse region it also an important place for thousands of years for many religions. Much of the beauty is observed from its rich culture and traditions. It also has some of the most important religious sites in the country. 
				</p>
